import React from 'react'

function BillForm() {
  return (
    <Modal>
     <form>
        <label>Bill number</label>
        <input type='text'></input>
        <label>Credit card</label>
        <input type='text'></input>
    </form>
    </Modal>
  )
}

export default BillForm;
